import "./Banner.css";
import { motion } from "framer-motion";
export default function Banner() {
  return (
    <motion.div
    initial={{ opacity: 0 }}
      animate={{ y: 100 }}
      transition={{ ease: "easeOut", duration: 2 }}
      id="banner"
      className="top-layer"
    >
      <h2 id="app-name"> Busy </h2>
    </motion.div>
  );
}
